--ETAPA 3/3: EXECUÇÃO DO COMANDO DE PIVOTIZAÇÃO
SELECT * FROM RECEBIMENTO_LEITE_2015  --OPCIONAL
GO

SELECT * 
FROM (	SELECT 
		PRODUTOR, 
		NOME_PRODUTOR,
		CPF,
		MES, 
		ANO, 
		SUM(VALOR_PAGO) AS VALOR_PAGO
	FROM RECEBIMENTO_LEITE_2015
	GROUP BY PRODUTOR, NOME_PRODUTOR, CPF, MES, ANO
) EM_LINHA

PIVOT 	(SUM(VALOR_PAGO) FOR MES IN ([JANEIRO],[FEVEREIRO],[MARÇO],[ABRIL],[MAIO],[JUNHO],[JULHO],[AGOSTO],[SETEMBRO],[OUTUBRO],[NOVEMBRO],[DEZEMBRO])) AS EM_COLUNAS
WHERE ANO = 2015 ORDER BY NOME_PRODUTOR
GO